import React from "react";
import Expense from "./components/Expense";
const App = () => {
  const expense = [
    {
      id: 'e1',
      title: 'Car Insurance',
      amount: 299.00,
      date: new Date(2021, 20, 22)
    },
    {
      id: 'e2',
      title: 'Buy Macbook',
      amount: 599.00,
      date: new Date(2021, 20, 25)
    },
    {
      id: 'e3',
      title: 'Buy PS5',
      amount: 220.00,
      date: new Date(2021, 20, 10)
    },
    {
      id: 'e4',
      title: 'Buy PS2',
      amount: 100.00,
      date: new Date(2021, 20, 5)
    },
  ]
  return (
    <div>
      <h1>Lets Get Started</h1>
      <Expense items={expense}/>
    </div>
  );
};

export default App;
